def solution(arr, rows_cnt, cols_cnt ):	res = []	for row in range(rows_cnt):		temp = [None] * cols_cnt		res.append(temp)		for row in range(rows_cnt):			for col in range(cols_cnt):			res[row][col] = arr[col][row]			return resdef main():	with open('input.txt', 'r') as f:		rows_cnt = int(f.readline().rstrip())		cols_cnt = int(f.readline().rstrip())				rows = []		for _ in range(rows_cnt):			row = f.readline().rstrip()			rows.append(list(map(int, row.split(' '))))	res = solution(rows, cols_cnt, rows_cnt)		with open('output.txt', 'w') as f:		for item in res:			f.write(' '.join(map(str, item)))			f.write('\n')if __name__ == '__main__':	main()